import React from 'react';
import { Link } from 'react-router-dom';  // For React Router navigation (if using)

import '../styles/index.css'; // Import CSS (adjust path as necessary)

const Header = () => {
  return (
    <header className="nav-bar-body">
      <div className="logo-nav-bar-container">
        <img src="../images/hera_logo.png" alt="Hera logo" className="logo" />

        <nav>
          <ul className="nav-links">
            <li><Link to="/homepage">Home</Link></li>
            <li><Link to="/about-us">About Us</Link></li>
            <li><Link to="/resources">Resources</Link></li>
          </ul>
        </nav>

        <div className="profile-icon">
          <Link to="/profile">
            <img src="../images/profile_icon.png" alt="Profile" />
          </Link>
        </div>
      </div>
    </header>
  );
};

export default Header;
